import React, { useEffect } from "react";
import { useDispatch, useSelector } from "react-redux";
import { fetchTodaysLeagueData } from "../../Redux/Actions";

const TodaysMatchResultsInner = () => {
  const data = useSelector((state) => state.todaysLeagueData);

  console.log(data);

  return <div>yoyoyo</div>;
};

export const TodaysMatchResults = (props) => {
  const dispatch = useDispatch();

  useEffect(() => {
    dispatch(
      fetchTodaysLeagueData({
        url: "https://api.jsonbin.io/b/5edaad9e2f5fd957fda48c88",
      })
    );
  }, [dispatch]);

  return <TodaysMatchResultsInner {...props} />;
};
